import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Landing from "../views/Landing";

function GlobalRouter() {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<Landing />}/>
                <Route path="/login" element={<Landing />}/>
            </Routes>
        </BrowserRouter>
    );
}

export default GlobalRouter;
